import React from 'react';

const ManageDoctor = () => {
    const { isLoading, error,refetch, data:users } = useQuery('users', () =>
    fetch(`http://localhost:5000/users`,{
        method:'GET',
        headers:{
            'authorization': `user ${localStorage.getItem('accessToken')}`
        }
    }).then(res =>
      res.json()))
    return (
        <div>
            ManageDoctor
        </div>
    );
};

export default ManageDoctor;
